	 La plupart de la musique électronique que j&apos;aime depuis mon enfance... Certains de ces morceaux pourraient éventuellement paraître ringards à des oreilles fragiles; par contre, d&apos;autres de ces morceaux sont carrément mauvais! =) ... Mais rien n&apos;est trop ringard pour inspirer un musicien. Il y a du bon dans toutes musiques. Le problème, ce n&apos;est pas les ingrédients, mais ce que vous cuisinez avec... Alors j&apos;espère que vous apprécierez ce mix et en tirerez ce qui pourrait être bon.
